import Flight from '../Search/flight.js'
import Hotel from '../Search/hotel.js'
import CarRental from '../Search/car.js'

const TabContentItems = [
  {
    id : 'flights',
    className : 'tab-pane active',
    content : '<Flight />'
  },
  {
    id : 'hotels',
    className : 'tab-pane fade',
    content : '<Hotel />'
  },
  {
    id : 'car-rental',
    className : 'tab-pane fade',
    content : '<CarRental />'
  }
]

export default TabContentItems;
